import Textarea from '../../ui/components/Textarea';
import {Code} from '../components/Code';

const TextAreaPage = (props) => {
    return (  
        <>
            <h1 className="content__hdr">TextArea</h1>
            <Textarea label="Label textarea" value="Some text..." />

            <Code>
                {`<Textarea \n\tlabel="Label textarea" \n\tvalue="Some text..." \n/>`}
            </Code>
        </>
    );
}

export default TextAreaPage;
